                  // e.preventDefault();
                  // e.stopPropagation();
                  fetch(`api/image/${sku.year}/${sku.season}/${sku.model}`)
                    .then(res => res.text())
                    .then(url => {
                      vnode.state.imgFetched = true
                      vnode.state.imgSrc = url;
                      vnode.state.loading = !vnode.state.loading;
